import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Alert Configuration</h2>
        <hr></hr>
        <div className='headings'>
          <div>+</div>
          <div>Alert Name</div>
          <div>Independent Variable</div>
          <div>Dependent Variable</div>
          <div>Frequency</div>
          <div>Save</div>
        </div>
      </header>
    </div>
  );
}

export default App;
